Here is a sample NixOS module that deploys a Typhon instance: { pkgs, ... }: let typhon = builtins.getFlake "github:typhon-ci/typhon";
in { imports = [ typhon.nixosModules.default ]; # enable experimental features nix.settings.experimental-features = [ "nix-command" "flakes" ]; # install Nix >= 2.18 if necessary nix.package = pkgs.nixVersions.nix_2_18; # enable Typhon services.typhon = { enable = true; # path to the argon2id hash of the admin password # $ SALT=$(cat /dev/urandom | head -c 16 | base64) # $ echo -n password | argon2 "$SALT" -id -e > /etc/secrets/password.txt hashedPasswordFile = "/etc/secrets/password.txt"; }; # configure nginx services.nginx = { enable = true; forceSSL = true; enableACME = true; virtualHosts."example.com" = { locations."/" = { proxyPass = "http://localhost:3000"; recommendedProxySettings = true; }; }; };
}

