Let's create a flake in the $config repository, then add an output typhonProject. We are going to import typhon as a flake input and use the github.mkProject helper function from the library: { inputs = {typhon.url = "github:typhon-ci/typhon";}; outputs = { self, typhon, }: { typhonProject = typhon.lib.github.mkProject { owner = "$user"; repo = "$project"; secrets = ./secrets.age; typhonUrl = "$typhon_url"; }; };
} We need to generate the secrets.age file. First let's write a secrets.json file containing the secrets you generated (don't commit it!): { "github_token": "$token", "github_webhook_secret": "$secret"
} Then, we encrypt the JSON file with age, using the public key of the project: nix run nixpkgs#age -- --encrypt -r "$pk" -o secrets.age secrets.json We also need to generate the lock file: nix flake lock Finally, we commit secrets.age, flake.nix and flake.lock.
